import React, { useEffect, useState } from 'react';
import { data } from '../../mocks/dummyData';

function ProjectDetails() {
  const[projects,setProjects] = useState([]);

  useEffect(() => {
    setProjects(data)
  },[projects]);
  return (
    <div>
        <ul>
           {projects.map(project => (
              <p>{project.name}</p>
           ))}
        </ul>
    </div>
  )
}

export default ProjectDetails
